column8:
●使いやすいブラシタイプなので、初めてでも簡単にお使いいただけます。<br>
●発毛促進、育毛、抜毛、薄毛に効果がある薬用育毛料です。<br>
●ニンジンエキスやキチンリキッドなどの保湿成分が有効成分の効果を高め、毛髪にうるおいを与えます。<br>
●オイルフリーなので、さらっとした感触です。<br><br>

【使用方法】<br>
朝晩、気になる所にご使用ください。また、油分が入りますと液が白く濁る事がありますので注意してください。目に入ったときは、水またはぬるま湯で洗い流してください。<br><br>

【ご注意】<br>
○目に入ったときは、水またはぬるま湯で洗い流してください。<br>
○他の成分が混入しますと液が白濁することがありますのでご注意ください。<br><br>

【成分】<br>
有効成分：パントテニールエチルエーテル、感光素301号<br>
その他の成分：ニンジンエキス、カルボキシメチルキチン液、ヒアルロン酸ナトリウム(2)、加水分解シルク液 、精製水、エタノール、
濃グリセリン、1.3-ブチレングリコール、アルギン酸ナトリウム、クエン酸、パラオキシ安息香酸エステル(+/-)クエン酸ナトリウム <br><br>

【内容量】<br>
7ml<br><br>

【販売元】<br>
アヴァンセ株式会社<br>
東京都六本木6-4-1<br>
お問い合わせ先：03-3403-3817<br><br>

【商品区分】<br>
医薬部外品<br><br>

［AVANCE/薬用育毛料/LASH SERUM EX］ 

