●8種類の美容成分で、ダメージが気になる目元を集中トリートメント！<br>
●スッピンでも“うるピュア”な目元へ導きます。<br><br>

【ご使用方法】<br>
●晩、洗顔後の清潔な肌にご使用ください。<br>
●目に入らないよう注意しながら、まつげの生え際から毛先、まぶた、涙袋へやさしくなじませてください。<br>
●マスカラを使用する際は、本品が乾いてからご使用ください。<br><br>

【ご注意】<br>
○傷、はれもの、湿疹など、異常のある時はご使用をおやめください。<br>
○使用中、または使用後日光に当たって、赤味・はれ・かゆみ・刺激等の異常があらわれた時は、使用を中止し、皮膚科専門医などへご相談をおすすめします。そのまま他の化粧品も含めて使用を続けますと、悪化することがあります。<br>
○使用後はキャップをしっかりと閉めてください。<br>
○乳幼児の手の届かないところに保管してください。<br>
○極端に高温または低温、直射日光のあたるところには置かないでください。<br>
○目に入らないようにご注意ください。目に入ってしまった場合は、こすらずに水道水でゆっくりと洗い流してください。異物感が残る場合は、眼科医に相談されることをおすすめします。<br><br>

【成分】<br>
水、BG、エタノール、プラセンタエキス、加水分解コラーゲン、ヒアルロン酸Na、加水分解エラスチン、ダイズ種子エキス、パンテノール、加水分解シルク、リン酸アスコルビルMg、カルボマー、グリセリン、ヒドロキシエチルセルロース、ポリソルベート80、水酸化K、メチルパラベン、フェノキシエタノール<br><br>

【内容量】<br>
1本<br><br>

【販売元】<br>
ノエビア<br>
東京都中央区銀座7－6－15 ノエビア銀座ビル<br>
